		public class Solution
		{
			public int MinMeetingRooms(Interval[] intervals)
			{
				var listIntervals = new List<Tuple<int, bool>>();
				foreach (var i in intervals)
				{
					listIntervals.Add(new Tuple<int, bool>(i.start, true));
					listIntervals.Add(new Tuple<int, bool>(i.end, false));
				}
				listIntervals.Sort(CompareInter);
				Console.WriteLine(listIntervals.Count);

				var listDebug = new Stack<Tuple<int, bool>>();
				var doOnce = true;
				var resp = 0;
				var countStarts = 0;
				foreach (var t in listIntervals)
				{
					if (t.Item2)
					{
						countStarts++;
						resp = Math.Max(resp, countStarts);
						if (resp == 2 && doOnce)
						{
							doOnce = false;
							Console.WriteLine(t.Item1);
						}
						listDebug.Push(t);
					}
					else { countStarts--; listDebug.Pop(); }
				}
				return resp;
			}

			private int CompareInter(Tuple<int, bool> a, Tuple<int, bool> b)
			{
				if (a.Item1.CompareTo(b.Item1) != 0) return a.Item1.CompareTo(b.Item1);
				return a.Item2.CompareTo(b.Item2);
			}
		}
	}
